import React from "react";
import { Auth } from "pages";
import { Route, Routes } from "react-router-dom"


class App extends React.Component {
  render() {
    return (
      <div className="wrapper">
        <Routes>
          {["/", "/login"].map(path =>
            <Route
              path={path}
              element={<Auth></Auth>}
            ></Route>
          )}
        </Routes>
      </div>
    )
  }
}



export default App;
